import React from "react";
import styled from "styled-components";
import TodoTitle from "./components/todoTitle";

const App = () => {
  return (
    <Body>
      <TodoTitle />
    </Body>
  );
};

const Body = styled.div`
  background-color: powderblue;
  height: 100vh;
`;
export default App;
